import React, { useState, useEffect, useCallback } from "react";
import axios from "axios";
import styled from "styled-components";

const Container = styled.div`
  font-family: "San Francisco", Helvetica, "Myriad Set";
  background-color: #f5f5f7;
  color: #333;
  max-width: 1200px;
  margin: 50px auto;
  padding: 20px;
  border-radius: 16px;
  box-shadow: 0px 15px 40px rgba(0, 0, 0, 0.1);
  text-align: center;
  border: 2px solid #007aff;
  position: relative;
`;

const Section = styled.div`
  margin: 20px 0;
`;

const ProgressBar = styled.div`
  width: 100%;
  background: #e0e0e0;
  border-radius: 12px;
  overflow: hidden;
  margin: 10px 0;
  position: relative;

  div {
    height: 45px;
    text-align: center;
    line-height: 45px;
    color: white;
    font-size: 18px;
    font-weight: bold;
    border-radius: 12px;
    transition: width 0.5s ease, background-color 0.3s ease, transform 0.3s ease;
    cursor: pointer;

    &:hover {
      background-color: #005bb5;
      transform: scale(1.05);
    }

    span {
      position: absolute;
      right: 10px;
      font-size: 16px;
      font-weight: bold;
    }
  }
`;

function CompetitorAnalysis() {
  const [keywordAnalysis, setKeywordAnalysis] = useState(null);

  useEffect(() => {
    const fetchKeywordAnalysis = async () => {
      try {
        const response = await axios.get("http://localhost:5000/videos");
        setKeywordAnalysis(response.data);
      } catch (err) {
        console.error("Failed to fetch keyword analysis.");
      }
    };

    fetchKeywordAnalysis();
  }, []);

  return (
    <Container>
      {keywordAnalysis && (
        <div>
          <h2>Keyword Analysis</h2>

          <Section>
            <h3>Top Keywords</h3>
            {keywordAnalysis.keywords?.map((keyword, index) => (
              <ProgressBar key={index}>
                <div style={{ width: `${Math.min((index + 1) * 10, 100)}%`, background: "#007aff" }}>
                  {keyword} <span>{Math.min((index + 1) * 10, 100)}%</span>
                </div>
              </ProgressBar>
            ))}
          </Section>

          <Section>
            <h3>Top Bigrams</h3>
            {keywordAnalysis.bigrams?.map((bigram, index) => (
              <ProgressBar key={index}>
                <div style={{ width: `${Math.min((index + 1) * 10, 100)}%`, background: "#34c759" }}>
                  {bigram} <span>{Math.min((index + 1) * 10, 100)}%</span>
                </div>
              </ProgressBar>
            ))}
          </Section>

          <Section>
            <h3>Top Trigrams</h3>
            {keywordAnalysis.trigrams?.map((trigram, index) => (
              <ProgressBar key={index}>
                <div style={{ width: `${Math.min((index + 1) * 10, 100)}%`, background: "#ff3b30" }}>
                  {trigram} <span>{Math.min((index + 1) * 10, 100)}%</span>
                </div>
              </ProgressBar>
            ))}
          </Section>

          <Section>
            <h3>TF-IDF Scores</h3>
            {Object.entries(keywordAnalysis.tfidfScores || {}).map(([word, score], index) => (
              <ProgressBar key={index}>
                <div style={{ width: `${Math.min(score * 10, 100)}%`, background: "#ff9500" }}>
                  {`${word}: ${score.toFixed(2)}`} <span>{Math.min(score * 10, 100)}%</span>
                </div>
              </ProgressBar>
            ))}
          </Section>

          <Section>
            <h3>Sentiment Score</h3>
            <ProgressBar>
              <div style={{ width: `${Math.min(keywordAnalysis.avgSentiment * 10, 100)}%`, background: "#ffcc00" }}>
                {keywordAnalysis.avgSentiment.toFixed(2)}
              </div>
            </ProgressBar>
          </Section>

          <Section>
            <h3>Suggested Keywords for Your Next Video</h3>
            {keywordAnalysis.suggestedKeywords?.map((keyword, index) => (
              <ProgressBar key={index}>
                <div style={{ width: `${Math.min((index + 1) * 10, 100)}%`, background: "#af52de" }}>
                  {keyword}
                </div>
              </ProgressBar>
            ))}
          </Section>

          <Section>
            <p><strong>Suggested Title:</strong> {keywordAnalysis.suggestedTitle || "N/A"}</p>
            <p><strong>Suggested Tags:</strong> {keywordAnalysis.suggestedTags?.join(", ") || "N/A"}</p>
          </Section>
        </div>
      )}
    </Container>
  );
}

export default CompetitorAnalysis;
